import classes from './Posts.module.css';
import Post from './post/Post'

const Posts = () => { 
   
    return ( 
       <div className={classes.posts}>
          <h1>My Posts</h1> 
          <input type="text" className={classes.text} placeholder='your news...'/>
          <input type="button" className={classes.btn} value="Send"/>
          <div className={classes.po}>
             <Post text="Hello"/>
          </div>
       </div>
       
    );
}

export default Posts;
